  [],\n\t\"revision_timestamp\": \"2015-05-06T20:42:00.966934\",\n\t\"name\": \"high-energy-single-frequency-resonant-amplifier-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR phase I project proposes a single
  frequency high energynresonant amplifier for remote sensing. Current state-of-art
  technologiesncan not provide all features of high energy and efficiency, compactness,nand
  narrow spectral width. PolarOnyx proposes, for the first time, anhigh energy (100
  mJ) resonant amplifier to meet with the requirement ofnsolicitation. This proposal
  is based on the spectral shaping sub-mJnfiber laser at 1550 nm we have achieved
  in our labs.  In the high powernamplifier stage, PolarOnyx proposes an innovative
  resonant cavity basednamplifier approach by employing our patent pending proprietaryntechnologies
  in hybrid high energy amplifiers, that will be able tonoperate at low repetition
  rate (10's Hz to 1 kHz) and reach high energynlevel of 100 mJ. These will make the
  hybrid fiber laser transmitternsystem superior in terms of wall plug efficiency
  (over 30&amp;#37;), energy(100nmJ), noise, size, and cost.  A tabletop experiment
  will be demonstratednin Phase I time frame for proof of concept. A compact prototype
  will bendelivered in Phase II.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
